import {
  Stack,
  Button
} from "@mui/material";
const Navbar = ()=>{
  const design = (
    <>
      <Stack sx={{ m: 2}}>
        <Stack direction="row" justifyContent="space-between">
        <h1>Testing</h1>
          <Stack direction="row">
          <Button variant="contained" sx={{
            mr:4
          }}>Button-1</Button>
          <Button variant="contained">Button-2</Button>
          </Stack>
        </Stack>
      </Stack>
    </>
  );
  return design;
}
export default Navbar;
